package com.amandris.clients.web.view;import org.apache.struts.action.ActionForm;public class StartInvitationView extends ActionForm{		private String credits;	private String expirationTime;	private String buyerId;	private String sellerId;	private String enabled;		private static final long serialVersionUID = 6137532804621273738L;		public StartInvitationView()	{		credits 		= "";		expirationTime 	= "";		buyerId 		= "";		sellerId 		= "";		enabled			= "";	}	public String getBuyerId() {		return buyerId;	}	public void setBuyerId(String buyerId) {		this.buyerId = buyerId;	}	public String getCredits() {		return credits;	}	public void setCredits(String credits) {		this.credits = credits;	}	public String getExpirationTime() {		return expirationTime;	}	public void setExpirationTime(String expirationTime) {		this.expirationTime = expirationTime;	}	public String getSellerId() {		return sellerId;	}	public void setSellerId(String sellerId) {		this.sellerId = sellerId;	}	public String getEnabled() {		return enabled;	}	public void setEnabled(String enabled) {		this.enabled = enabled;	}		}